import "../styles/userProfile.css"

function UserProfile(props){

    const uid = localStorage.getItem("id");

    return(
        <div>
            <div className="user-profile-container">
                <img src={props.src} alt="user profile" />
                <p>{props.username}</p>
            </div>
            <div id={uid}>
                
            </div>
        </div>
        

    )
}

export default UserProfile;
